import React from 'react';
import { useState } from 'react';
import { StyleSheet, Text, View, Button, TextInput, ScrollView } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import LandingPage from './components/screens/LandingPage';
import QuestionsForProviders from './components/screens/QuestionsForProviders';
import HomePage from './components/HomePage'

const App = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator>

      </Stack.Navigator>
      <Button title = "App" onPress={() => navigation.navigate('HomePage')} />
      <Text>hello</Text>
    </NavigationContainer>

  );
};

const Stack = createNativeStackNavigator();

const MyStack = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen
          name="Home"
          component={HomePage}
          options={{title: 'Welcome'}}
        />
        <Stack.Screen name="QuestionsForProviders" component={QuestionsForProviders} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

const QuestionsForProvidersScreen = ({navigation, route}) => {
  return <Button
  title="Go to Jane's profile"
  onPress={() =>
    navigation.navigate('QuestionsForProviders')
  }
/>
};


export default App;
